import React from "react";

import { ContainerPage, TittlePage } from "../../components/Main";

const Page = () => {
    return (

        <ContainerPage>

           <div className="tittle-page">
                <img src="../../../Settings.png"></img>
                <h3><strong>Configurações</strong></h3>
           </div>

           <section className="body-page">
                <h3>Meus Interesses:</h3>
                <div className="form-element">
                            <input type="checkbox" name="interest-area" value="Back-End" id="back-end" />
                            <label htmlFor="back-end">
                                <img className="img-icon" src="../../../backend.png" alt="Back-End" />
                                <div className="title">
                                    Back-End
                                </div>
                            </label>
                        </div>
           </section>


        </ContainerPage>

    );
}

export default Page;
